import { render } from '@testing-library/react';
import React from 'react';
import Card from './Card';

const CardList = ({robots}) => {
    const cardArray= robots.map((user, i)  => {
        return 
            <
            Card 
            key={robots.id} 
            id={robots[i].id} 
            name={robots[i].name} 
            email={robots[i].email}
        />
    })
    return(
        <div>
            {cardArray}
        </div>
    );
}

export default CardList;
